import styled from "styled-components";

const SettingBox = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 10em;
  height: 10em;

  border: 1px solid #718093;
  border-radius: 4px;
`;

export default SettingBox;
